const TodoList = ({ todolist, text }) => {
  return (
    <div className="todo-list">
      <h2>{text}</h2>
      <input type="text" />
      What need to be done?
      {todolist.map((todo) => (
        <div className="todo-preview" key={todo.id}>
          <p>{todo.text}</p>
        </div>
      ))}
    </div>
  );
};

export default TodoList;
